								level.player, [~Makes sense.~],
							set(Berd.animation, 'emote_gesticulate'),
								Berd, [~Your big problem will be that\\nthe gate connecting the two halves\\nof the town has been locked.~],
							set(Berd.animation, 'emote_wry'),
								Berd, [~And I don't think there's a guard next\\nto it, whom you can steal the key from.~],
							set(Berd.animation, 'emote_confused'),
								Berd, [~In fact I don't think there IS a key.\\nI think that door might be machine-controlled.~],
							set(Berd.animation, 'emote_talk'),
								Berd, [~I don't know where the controls would be,\\nthough.  I'm not from here, after all.~],
							set(Berd.animation, 'emote_gesticulate'),
